def solve(lst):
    res = []
    cur = None
    count = 0
    for i in range(len(lst)):
        if lst[i] == cur:
            count += 1
        else:
            if count:
                res.append((count, cur))
            cur = lst[i]
            count = 1
    if count:
        res.append((count, cur))
    return res
